import React from 'react';
import Profile from './profile';
import SimpleBar from "simplebar-react";
import SidebarContent from './SidebarContent';


const Seller = () => {
    return (
        <>
            <SimpleBar style={{ maxHeight: "100%" }}>
                <SidebarContent />
            </SimpleBar>
            <Profile />
        </>
    )

}

export default Seller;
